const sidebarNavItems = [
  {
    to:'/home',
    subItems: [
      {
        to:'/home',
      }
    ]
  },
  {
    display: "Movies",
    icon: <i className="bx bx-chevron-down"></i>,
    section: "Movies",
    subItems: [
      {
        display: "Movies",
        to:'/movies',
      }
    ],
  },
  {
    display: "People",
    icon: <i className="bx bx-chevron-down"></i>,
    section: "People",
    subItems: [
      {
        display:"People",
      }
    ],
  },
  {
    display: "Planets",
    icon: <i className="bx bx-chevron-down"></i>,
    section: "Planets",
    subItems: [
      {
        display:'Planets',
        to:'/planets'
      }
    ],
  },
  {
    display:'Species',
    icon: <i className="bx bx-chevron-down"></i>,
    section: "Species",
    subItems: [
      {
        display:'Species',
      }
    ],
  },
  {
    display:'StarShips',
    icon: <i className="bx bx-chevron-down"></i>,
    section: "Starships",
    subItems: [
      {
        display:'StarShips',
      }
    ],
  },
  {
    display:'Vehicles',
    icon:<i className="bx bx-chevron-down"></i>,
    section: 'Vehicles',
    subItems: [
      {
        display:'Vehicle',
      }
    ],
  },
];

export default sidebarNavItems;
